import React from "react";
import Card from './components/Card'

class App extends React.Component {
    state = {
        data: []
    }

    render() {
        const data = this.state.data;
        return (
            <div className="wrapper">
                <div className="app">
                   <Card data={data}/>
                </div>
            </div>
        );
    };
}

export default App;
